var data = `



`
.split('\n');

// data = 'RRUU';

var coordinates = [ [null,null,'1',null,null],
                    [null,'2','3','4',null],
                    ['5','6','7','8','9'],
                    [null,'A','B','C',null],
                    [null,null,'D',null,null] ];
var corX = 0;
var corY = 2;

function getRowXmaxmin() {
  var row = coordinates[corY];
  var i;
  for (i = 0; i < row.length; i++) {
    if(row[i]!=null)
      break;
  }
  return {min: i, max:  row.length-1-i};
}
function getColYmaxmin() {
  var y;
  for (y = 0; y < coordinates.length; y++) {
    if(coordinates[y][corX]!=null)
      break;
  }
  return {min: y,max: coordinates.length-1-y};
}

function step(instruction) {
  switch (instruction) {
    case 'D':
      if (corY < getColYmaxmin().max) {
        corY++;
      }
      break;
    case 'U':
      if (corY > getColYmaxmin().min) {
        corY--;
      }
      break;
    case 'R':
      var max = getRowXmaxmin();
      if(corX < max.max) {
        corX++;
      }
      break;
    case 'L':
      if (corX > getRowXmaxmin().min) {
        corX--;
      }
      break;
  }
}
var code = '';
for (var i = 0; i < data.length; i++) {
  instructions = data[i];
  for (var letter = 0; letter < instructions.length; letter++) {
    step(instructions[letter]);
  }
  code += coordinates[corY][corX];
}
console.log(code);